pragma solidity ^0.5.0;

library StringUtils {
    /// @dev Does a byte-by-byte lexicographical comparison of two strings.
    /// @return a negative number if `_a` is smaller, zero if they are equal
    /// and a positive numbe if `_b` is smaller.
    function compare(string memory _a, string memory _b) public returns (int) {
        bytes memory a = bytes(_a);
        bytes memory b = bytes(_b);
        uint minLength = a.length;
        if (b.length < minLength) minLength = b.length;
        //@todo unroll the loop into increments of 32 and do full 32 byte comparisons
        for (uint i = 0; i < minLength; i ++)
            if (a[i] < b[i])
                return -1;
            else if (a[i] > b[i])
                return 1;
        if (a.length < b.length)
            return -1;
        else if (a.length > b.length)
            return 1;
        else
            return 0;
    }
    /// @dev Compares two strings and returns true iff they are equal.
    function equal(string memory _a, string memory _b) public returns (bool) {
        return compare(_a, _b) == 0;
    }
    /// @dev Finds the index of the first occurrence of _needle in _haystack
    function indexOf(string memory _haystack, string memory _needle) public returns (int)
    {
    	bytes memory h = bytes(_haystack);
    	bytes memory n = bytes(_needle);
    	if(h.length < 1 || n.length < 1 || (n.length > h.length))
    		return -1;
    	else if(h.length > (2**128 -1)) // since we have to be able to return -1 (if the char isn't found or input error), this function must return an "int" type with a max length of (2^128 - 1)
    		return -1;
    	else
    	{
    		uint subindex = 0;
    		for (uint i = 0; i < h.length; i ++)
    		{
    			if (h[i] == n[0]) // found the first char of b
    			{
    				subindex = 1;
    				while(subindex < n.length && (i + subindex) < h.length && h[i + subindex] == n[subindex]) // search until the chars don't match or until we reach the end of a or b
    				{
    					subindex++;
    				}
    				if(subindex == n.length)
    					return int(i);
    			}
    		}
    		return -1;
    	}
    }
}

contract Property {
    // Model a Candidate
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
        uint licenseNumber;
        uint registrationNumber;
        uint size;
        string location;
        uint rooms;
        uint price;
        string ownerName;
        address ownerAddress;
    }

    // Store accounts that have voted
    mapping(address => bool) public voters;
    // Store Candidates
    // Fetch Candidate
    mapping(uint => Candidate) public candidates;
    // Store Candidates Count
    uint public candidatesCount;

    // voted event
    event votedEvent (
        uint indexed _candidateId
    );

    constructor () public {
        addCandidate("House A", 1234, 1111, 120, "NED", 4, 250, "Ali");
        addCandidate("House B", 2541, 2222, 240, "Johar", 6, 750, "Furqan");
        addCandidate("House C", 1234, 1111, 120, "NED", 4, 250, "Ali");
        addCandidate("House D", 2541, 2222, 240, "Johar", 6, 750, "Furqan");
    }

    function addCandidate (string memory _name, uint _licenseNumber, uint _registrationNumber, uint _size, string memory _location, uint _rooms, uint _price, string memory _ownerName) public {
        candidatesCount ++;
        address senderAddress = msg.sender;
        candidates[candidatesCount] = Candidate(candidatesCount, _name, 0, _licenseNumber, _registrationNumber, _size, _location, _rooms, _price, _ownerName, senderAddress);
    }

    function vote (uint _candidateId) public {
        // require that they haven't voted before
        require(!voters[msg.sender]);

        // require a valid candidate
        require(_candidateId > 0 && _candidateId <= candidatesCount);

        // record that voter has voted
        voters[msg.sender] = true;

        // update candidate vote Count
        candidates[_candidateId].voteCount ++;

        // trigger voted event
        emit votedEvent(_candidateId);
    }

    mapping(uint => string) documents;


    function storeDocument(uint id, string memory docHash) public {

        documents[id] = docHash;
    }

    function verifyDocument(uint id, string memory hashToVerify) public returns (bool){
        if(StringUtils.equal(documents[id],hashToVerify)) {
            return true;
        }
        else{
            return false;
        }
     }

}

